export default function updateStudentGradeByCity(myArray, city, newGrades) {
  function gra(id, grades) {
    for (const gr of grades) {
      if (gr.studentId === id) {
        return gr.grade;
      }
    }
    return 'N/A';
  }
  const res = myArray.filter((student) => student.location === city);
  return res.map((stud) => (
    stud.set('grade', gra(stud.id, newGrades))
  ));
}

